import React from 'react';
import './Common.css';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="container">
        <p>&copy; 2024 EduList. All rights reserved.</p>
        <p>Find the best educational institutions near you.</p>
      </div>
    </footer>
  );
};

export default Footer;
